import React, { useState } from 'react';
import { Drawer, List, ListItem, ListItemText, IconButton } from '@mui/material';
import MenuIcon from '@mui/icons-material/Menu';
import CancelIcon from '@mui/icons-material/Cancel';
import Brightness2Icon from '@mui/icons-material/Brightness2';
import WbSunnyIcon from '@mui/icons-material/WbSunny';

const Header = ({ toggleTheme }) => {
  const [menuOpen, setMenuOpen] = useState(false);

  const handleMenuClick = () => {
    setMenuOpen(!menuOpen);
  };

  const handleCancelClick = () => {
    setMenuOpen(false);
  };

  return (
    <>
      <div className="navBar">
        <div>
          <a className="logo" href="#">
            <h1 style={{ fontWeight: "700", fontSize: "30px" }}>
              sid<span style={{ color: "red" }}>.</span>dev
            </h1>
          </a>
        </div>
        <div>
          <ul className="ul">
            <a className="li" href="#">
              <li>Home</li>
            </a>
            <a className="li" href="#about">
              <li>About Me</li>
            </a>
            <a className="li" href="#project">
              <li>Projects</li>
            </a>
            <a className="li" href="#contact">
              <li>Contact</li>
            </a>
            <IconButton id="themeToggle" onClick={toggleTheme}>
            {toggleTheme.theme === 'light' ? <Brightness2Icon /> : <WbSunnyIcon />}
          </IconButton>
          </ul>


          <IconButton
            style={{ fontSize: "5rem" }}
            id="menu-stack"
            onClick={handleMenuClick}
          >
            {menuOpen ? (
              <CancelIcon onClick={handleCancelClick} />
            ) : (
              <MenuIcon />
            )}
          </IconButton>
        </div>
      </div>

      <Drawer anchor="right" open={menuOpen} onClose={() => setMenuOpen(false)}>
        <IconButton onClick={handleCancelClick}>
          <CancelIcon style={{ marginLeft: "15rem" }} />
        </IconButton>
        <List id="toggleList">
          <a href="#">
            <ListItem id="ListItem" onClick={() => setMenuOpen(false)}>
              <ListItemText primary="Home" />
            </ListItem>
          </a>
          <a href="#about">
            <ListItem id="ListItem" onClick={() => setMenuOpen(false)}>
              <ListItemText primary="About" />
            </ListItem>
          </a>
          <a href="#project">
            <ListItem id="ListItem" onClick={() => setMenuOpen(false)}>
              <ListItemText primary="Projects" />
            </ListItem>
          </a>
          <a href="#contact">
            <ListItem id="ListItem" onClick={() => setMenuOpen(false)}>
              <ListItemText primary="Contact" />
            </ListItem>
          </a>
        </List>
      </Drawer>
    </>
  );
};

export default Header;
